        }
    }

    handleInputChange=(event)=>{
        console.log(event.target.name);
        console.log(event.target.checked)
    }

    render(){
        return(
            <form>
        <label>
          Eat
          <input
            name="isGoing"
            type="checkbox"
            checked={this.state.eat}
            onChange={this.handleInputChange} />
        </label><br/>
        <label>
          Read
          <input
            name="isGoing"
            type="checkbox"
            checked={this.state.read}
            onChange={this.handleInputChange} />
        </label><br/>
        <label>
          Sleep
          <input
            name="isGoing"
            type="checkbox"
            checked={this.state.sleep}
            onChange={this.handleInputChange} />
        </label><br/>
        <label>
          Repeat
          <input
            name="isGoing"
            type="checkbox"
            checked={this.state.repeat}
            onChange={this.handleInputChange} />
        </label><br/>
       <button onClick={this.handlesubmit}>
           DONE
       </button>

      </form>
        )
    }
}


export default Task_Form;
